import React, {useEffect, useState} from "react";
import {useParams} from 'react-router-dom'
import axios from "axios";


const ProductPage = () => {
    const [appState, setAppState] = useState()
    const {id} = useParams()

    useEffect(()=> {
        axios.get('https://jsonplaceholder.typicode.com/photos?_page=1')
        .then(res=> {
            const data = res;
            setAppState(data)
        })
}, [setAppState])

    return (
        <div>{appState()}</div>
    )
}

export default ProductPage;
